import styles from './styles.module.css';

const Skills = () => {
  return (
    <div className={styles.container}>
      <h1>Skills</h1>
      <div className={styles.col}>
        <p>Javascript ES6</p>
        <p>CSS3</p>
        <p>React</p>
        <p>Vue</p>
        <p>Styled Components</p>
        <p>Sass</p>
      </div>
    </div>
  );
};

export default Skills;
